const Stock = new stockGame;
let cStockV;

function response(t, e, s, i, r, o, n) {
    try {
        if (e.startsWith("/주식 ")) {
            let t = e.slice(4).split("#");
            switch (t[0]) {
                case "가입":
                    r.reply(Stock.join(s));
                    break;
                case "매수":
                    Stock.isUE(s) ? r.reply(Stock.type("buy", s, {
                        item: t[1],
                        amount: t[2]
                    })) : r.reply("가입 먼저 해주세요.");
                    break;
                case "매도":
                    Stock.isUE(s) ? r.reply(Stock.type("sell", s, {
                        item: t[1],
                        amount: t[2]
                    })) : r.reply("가입 먼저 해주세요.");
                    break;
                case "잔고":
                    Stock.isUE(s) ? r.reply(Stock.myInfo(s)) : r.reply("가입 먼저 해주세요.");
                    break;
                case "종목":
                    r.reply(Stock.cList());
                    break;
                case "순위":
                    r.reply(Stock.rank());
            }
        }
        let t = (new Date).getMinutes();
        void 0 === cStockV ? cStockV = t : cStockV !== t && (cStockV = t, Stock.cStockPrice());
    } catch (t) {
        r.reply(t);
    }
}

function stockGame() {
    this.list = {
        "company A": {
            price: 8900,
            lnp: 8900,
            cSv: 100
        },
        "company B": {
            price: 3300,
            lnp: 3300,
            cSv: 30
        },
        "company C": {
            price: 650,
            lnp: 650,
            cSv: 6
        },
        "company D": {
            price: 2890,
            lnp: 2890,
            cSv: 20
        },
        "company E": {
            price: 17000,
            lnp: 17000,
            cSv: 200
        }
    }, this.user = {};
  }
  
