stockGame.prototype.join = function(t) {
    let e;
    return void 0 === this.user[t] ? (this.user[t] = {}, this.user[t].wallet = 1e6, this.user[t].oPv = 1e6, this.user[t].stock = {}, Object.keys(this.list).map(e => this.user[t].stock[e] = 0), e = "가입 완료!") : e = "이미 가입했습니다.", e;
}, stockGame.prototype.isUE = function(t) {
    return void 0 !== this.user[t];
}, stockGame.prototype.cList = function() {
    let t = [];
    for (let e in this.list) t.push(e + " | " + this.mV(this.list[e].price, this.list[e].lnp) + "\n현재가: " + this.nC(this.list[e].price) + "₩");
    return "[주식 종목]\n\n" + t.join("\n\n");
}, stockGame.prototype.mV = function(t, e) {
    return ((t - e) / e * 100).toFixed(2) + "%";
}, stockGame.prototype.type = function(t, e, s) {
    if (!this.nValue(s.item)) throw new Error("Item Does Not Exist");
    if (this.cN(s.amount)) {
        let i;
        switch (t) {
            case "sell":
                i = this.sell(e, s.item, s.amount);
                break;
            case "buy":
                i = this.buy(e, s.item, s.amount);
                break;
            default:
                throw new Error("Type Not Allowed");
        }
        return i;
    }
}, stockGame.prototype.nValue = function(t) {
    return void 0 !== this.list[t];
}, stockGame.prototype.nC = function(t) {
    return t.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ",");
}, stockGame.prototype.myInfo = function(t) {
    let e, s = [];
    if (void 0 !== this.user[t]) {
        for (let e in this.user[t].stock) s.push(e + " | " + this.user[t].stock[e] + "주");
        e = "[내 주식 잔고]\n닉네임: " + t + "\n보유 자산: " + this.nC(this.user[t].wallet) + "₩\n총평가금액: " + this.nC(this.sAv(t)) + "₩\n\n-보유 주식-\n" + s.join("\n");
    } else e = "유저 정보를 찾을 수 없습니다.";
    return e;
}, stockGame.prototype.sell = function(t, e, s) {
    if (this.cN(s)) {
        let i = this.list[e].price;
        return this.user[t].stock[e] >= Number(s) ? (this.user[t].wallet += i * Number(s), this.user[t].stock[e] -= Number(s), "[주문 체결]\n\n종목: " + e + "\n매도 가격: " + this.nC(i) + "₩\n수량: " + s + "\n\n종합: +" + this.nC(i * Number(s)) + "₩") : "매도 가능 물량을 초과했습니다";
    }
}, stockGame.prototype.cN = function(t) {
    if (/^(\-|\+)?([0-9]+)$/.test(t) && parseInt(t) > 0) return !0;
    throw new Error("Number Must Be Integer");
}, stockGame.prototype.buy = function(t, e, s) {
    if (this.cN(s)) {
        let i = this.list[e].price;
        return this.user[t].wallet >= i * Number(s) ? (this.user[t].wallet -= i * Number(s), this.user[t].stock[e] += Number(s), "[주문 체결]\n\n종목: " + e + "\n매수 가격: " + this.nC(i) + "₩\n수량: " + s + "\n\n종합: -" + this.nC(i * Number(s)) + "₩") : "주문 가능 가격을 초과했습니다.";
    }
}, stockGame.prototype.rN = function(t) {
    let e = Math.random(),
        s = Math.floor(Math.random() * t + 1);
    return e > .5 ? s = s : s *= -1, s;
}, stockGame.prototype.sAv = function(t) {
    if (this.isUE(t)) {
        let e = this.user[t].wallet;
        for (let s in this.user[t].stock) e += this.list[s].price * this.user[t].stock[s];
        return e;
    }
    throw new Error("User Undefined");
}, stockGame.prototype.rank = function() {
    let t = [];
    for (let e in this.user) t.push({
        nickname: e,
        wallet: this.sAv(e)
    });
    t.sort((t, e) => e.wallet - t.wallet);
    for (let e in t) t[e] = Number(e) + 1 + "위 | " + t[e].nickname + "\n총평가금액: " + this.nC(t[e].wallet) + "₩\n예상수익률: " + this.mV(t[e].wallet, this.user[t[e].nickname].oPv);
    return "[주식 순위]\n\n" + t.join("\n\n");
}, stockGame.prototype.cStockPrice = function() {
    for (let t in this.list) this.list[t].price += this.rN(this.list[t].cSv);
};
